import React, { useState } from 'react';
import axios from 'axios'; // API 

const StocksProvider = {
    GetGME: async function() {
        await axios.get('http://localhost:8080/api/v1/stocks')
        .then((response) => {
            return response.data;
        }).catch((err) => {
            console.log("Promise Rejected", err.message);
        })
    },
}

export default StocksProvider
